INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "アヤネ", "2020/07/31 12:00:00", 2, 102301, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, "2030/12/17 14:59:59", 24001, 2, 401);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "アヤネ", "2020/07/31 12:00:00", 2, 102301, 2.21, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, "2030/12/17 14:59:59", 24002, 1, 402);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "アヤネ", "2020/07/31 12:00:00", 2, 102301, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, "2030/12/17 14:59:59", 24003, 2, 403);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "アサヒ", "2020/07/31 12:00:00", 1, 192201, 1.99, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, "2030/12/17 14:59:59", 24004, 2, 701);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "アサヒ", "2020/07/31 12:00:00", 2, 192201, 2.21, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, "2030/12/17 14:59:59", 24005, 1, 702);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "アサヒ", "2020/07/31 12:00:00", 1, 192201, 3.33, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, "2030/12/17 14:59:59", 24006, 2, 703);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "部員３", "2020/07/31 12:00:00", 2, 192301, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, "2030/12/17 14:59:59", 24007, 2, 801);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "部員３", "2020/07/31 12:00:00", 2, 192301, 2.68, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, "2030/12/17 14:59:59", 24008, 1, 802);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "部員３", "2020/07/31 12:00:00", 2, 192301, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, "2030/12/17 14:59:59", 24009, 2, 803);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "", "2020/07/31 12:00:00", 1, 192501, 0.0, "やった！", 0.0, "2030/12/17 14:59:59", 24010, 1, 501);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "", "2020/07/31 12:00:00", 1, 192501, 0.0, "勝ったよ！", 0.0, "2030/12/17 14:59:59", 24011, 1, 502);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "", "2020/07/31 12:00:00", 1, 192501, 0.0, "いい調子！", 0.0, "2030/12/17 14:59:59", 24012, 1, 503);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ミサト", "2020/07/31 12:00:00", 2, 113501, 5.33, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, "2030/12/17 14:59:59", 24013, 6, 111);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ミサト", "2020/07/31 12:00:00", 2, 113501, 6.85, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, "2030/12/17 14:59:59", 24014, 1, 112);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ミサト", "2020/07/31 12:00:00", 2, 113501, 3.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, "2030/12/17 14:59:59", 24015, 1, 113);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ダイチ", "2020/07/31 12:00:00", 2, 192401, 6.11, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, "2030/12/17 14:59:59", 24016, 1, 611);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ダイチ", "2020/07/31 12:00:00", 2, 192401, 6.75, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, "2030/12/17 14:59:59", 24017, 1, 612);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ダイチ", "2020/07/31 12:00:00", 2, 192401, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, "2030/12/17 14:59:59", 24018, 2, 613);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ハツネ", "2020/07/31 12:00:00", 1, 113401, 4.52, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, "2030/12/17 14:59:59", 24019, 2, 211);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ハツネ", "2020/07/31 12:00:00", 1, 113401, 3.89, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, "2030/12/17 14:59:59", 24020, 2, 212);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "ハツネ", "2020/07/31 12:00:00", 2, 113401, 13.49, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, "2030/12/17 14:59:59", 24021, 1, 213);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "カヤ", "2020/07/31 12:00:00", 2, 106501, 3.17, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, "2030/12/17 14:59:59", 24022, 1, 311);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "カヤ", "2020/07/31 12:00:00", 2, 106501, 4.42, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, "2030/12/17 14:59:59", 24023, 1, 312);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "カヤ", "2020/07/31 12:00:00", 1, 106501, 2.89, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, "2030/12/17 14:59:59", 24024, 6, 313);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "アヤネ", "2020/07/31 12:00:00", 3, 102301, 3.71, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, "2030/12/17 14:59:59", 24025, 4, 421);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "アサヒ", "2020/07/31 12:00:00", 1, 192201, 5.1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, "2030/12/17 14:59:59", 24026, 2, 721);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "部員３", "2020/07/31 12:00:00", 3, 192301, 4.34, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, "2030/12/17 14:59:59", 24027, 1, 821);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, 0.0, "", "2020/07/31 12:00:00", 1, 192501, 0.0, "いい勝負だったよ\nまたやろうね", 0.0, "2030/12/17 14:59:59", 24028, 1, 521);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, -360.0, "ミサト", "2020/07/31 12:00:00", 2, 113501, 5.62, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, "2030/12/17 14:59:59", 24029, 1, 101);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, -360.0, "ミサト", "2020/07/31 12:00:00", 2, 113501, 9.58, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, "2030/12/17 14:59:59", 24030, 1, 102);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, -360.0, "ミサト", "2020/07/31 12:00:00", 2, 113501, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, "2030/12/17 14:59:59", 24031, 2, 103);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, -360.0, "ミサト", "2020/07/31 12:00:00", 1, 113501, 9.13, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, "2030/12/17 14:59:59", 24032, 2, 104);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24, -360.0, "ミサト", "2020/07/31 12:00:00", 2, 113501, 8.27, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, "2030/12/17 14:59:59", 24033, 1, 105);
